import React from 'react'


function REST(props){
  console.log(props);
  return(
    <>
    <img height={200} src='/assets/food.jpg' alt="restaurant pic" />
    <ul>
      {props.plate.map((val,idx)=>
        (<li key={idx}>{val}</li>)
      )}
    </ul>
    </>
  )
}

const DISHES=[
  "biryani",
  "breakfast",
  "mutton"
]

const App = () => {
  return (
    <React.Fragment>
      <KAPSE name="anil"/>
      <REST plate={DISHES}/>
    </React.Fragment>
  )
}

export default App
